objetoCompra:
Aquisição de sacos para esterilização em autoclave, nos padrões estabelecidos na NBR 9191, NBR 7500 e RDC 222 da Anvisa. 

- saco para esterilização em autoclave e descarte, 20 L;

- saco para esterilização em autoclave e descarte, 50/60 L;

- saco para esterilização em autoclave e descarte, 100 L.

A finalidade deste Contrato é garantir aos militares da ativa, da reserva ou reformados, pensionistas e seus dependentes e Servidores Civis do Exército Brasileiro (ativos e inativos) e dependentes diretos e indiretos, nas condições especificadas neste instrumento e no edital, por intermédio de clínicas, prestação de serviço de reabilitação.
